import { useNavigate } from "react-router-dom";
import axios from 'axios'

import '../styles/Login.css'

const login = () => {
    // const navigate = useNavigate();

    const clickToLogin = () => {
        // navigate("/");
    };
    
    return (
        <div id="loginBody">
            <div className="container">
                <form className="form" id="login">
                    <h1 className="title">Login</h1>
                    <div id="msg" className="message message_error" />
                    <div className="input_group">
                        <input type="text" id="loginUsername" className="input" autofocus placeholder="Username or email" />
                    </div>
                    <div className="input_group">
                        <input type="password" id="loginUserpwd" className="input" autofocus placeholder="Password" />
                    </div>
                    <button onClick={clickToLogin} className="btn" type="submit" >Continue</button>
                    <p className="text">
                        <a href="#" className="link">Forgot your password?</a>
                    </p>
                    <p className="text">
                        <a href="signupForm.html" className="link" id="linkCreateAccount">Don't have an account? Create account</a>
                    </p>
                </form>
            </div>
        </div>
    );
}

export default login;
